pragma solidity ^0.5.0;

import "@openzeppelin/contracts/GSN/Context.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";

interface MakerCDP {
    function open() external returns (bytes32 cup);
    function join(uint wad) external; // Join PETH
    function exit(uint wad) external; // Exit PETH
    function give(bytes32 cup, address guy) external;
    function lock(bytes32 cup, uint wad) external;
    function free(bytes32 cup, uint wad) external;
    function draw(bytes32 cup, uint wad) external;
    function wipe(bytes32 cup, uint wad) external;
    function shut(bytes32 cup) external;
    function per() external view returns (uint ray);
    function lad(bytes32 cup) external view returns (address);
}

interface IVaultManager {
    event Deposit(address indexed from, uint256 value);
    event Transfer(address indexed from, uint256 value, uint256 remaining);
}

contract VaultManager is IVaultManager, Ownable {
    using SafeMath for uint256;


    function deposit () payable public returns (bool) {
        emit Deposit(msg.sender, msg.value);
        return true;
    }

    function transfer(address payable recipient, uint256 amount) onlyOwner() public returns (bool) {
        require(amount <= address(this).balance);
        recipient.transfer(amount);
        uint256 remainingBalance = address(this).balance;
        emit Transfer(recipient, amount, remainingBalance);
        return true;
    }

    function withdraw(uint amount) onlyOwner() public returns (bool) {
        require(amount <= address(this).balance);
        msg.sender.transfer(amount);
        return true;
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

}
